contract WDnero is ERC20, ReentrancyGuard {
    uint prevBalance = 0;

    event  Deposit(address indexed dst, uint amount);
    event  Withdrawal(address indexed src, uint amount);

    constructor() ERC20("Wrapped Dnero", "WDNERO") {}

    fallback() external nonReentrant {
        _deposit();
    }

    function deposit() external nonReentrant {
        _deposit();
    }

    function withdraw(uint amount) external nonReentrant {
        require(balanceOf(msg.sender) >= amount, "Insufficient balance");
        require(amount > 0, "No dnero amount to withdraw");

        prevBalance = getDneroBalance() - amount;

        _burn(msg.sender, amount);        
        _transferDnero(msg.sender, amount);
        emit Withdrawal(msg.sender, amount);
    }

    function _deposit() private {
        uint currBalance = getDneroBalance();
        uint msgDneroValue = currBalance - prevBalance;
        prevBalance = currBalance;

        require(msgDneroValue > 0, "No dnero amount to deposit");

        _mint(msg.sender, msgDneroValue);
        emit Deposit(msg.sender, msgDneroValue);
    }

    function _transferDnero(address dst, uint amount) private {
        bytes memory data = new bytes(20+32);
        bytes32 amountBytes = bytes32(amount);
        uint idx = 0;
        uint i;
        for (i = 0; i < 20; i ++) {
            data[idx++] = (bytes20)(dst)[i];
        }
        for (i = 0; i < 32; i ++) {
            data[idx++] = amountBytes[i];
        }
        (bool success,) = address(0xcb).call(data); // 0xcb: precompiled contract for Dnero transfer
        require(success, "failed to call precompiled contract to transfer Dnero");
    }

     function getDneroBalance() public view returns (uint256) {
        bytes memory data = abi.encodePacked(address(this));
        (bool success, bytes memory result) = address(0xc9).staticcall(data); // 0xc9: precompiled contract for Dnero balance retrieval

        require(success, "failed to call precompiled contract to query the Dnero balance");
        require(result.length <= 32, "bytes to uint256 conversion will overflow");

        uint256 balance = abi.decode(result, (uint256));

        return balance;
    }

    function _bytesToUint256(bytes memory valBytes) private pure returns (uint256) {
        bytes32 val;
        uint len = valBytes.length;
        require(len <= 32, "bytes to uint256 conversion overflows");
        for (uint i = 0; i < len; i++ ) {
            val |= bytes32(valBytes[i] & 0xFF) >> ((32 - len + i) * 8);
        }
        return uint(val);
    }
}

